description:
Examination and Diagnosis, Complete, Mixed Dentition, to include:
(a) Extended examination and diagnosis on mixed dentition, recording history, charting, treatment planning and case presentation, including above description as per 01100; 
(b) Eruption sequence, tooth size -jaw size assessment

Examination and Diagnosis, Stomatognathic Dysfunctional, Comprehensive, to include:  
(a) History, Medical, Dental, Pain/ Dysfunction;  
(b) Clinical Examination to include, general appraisal, examination of head and neck, musculoskeletal system (static and functional); Intraoral examination of hard and soft tissues, including occlusal analysis; consultation with other health care professionals, review of previous records, including radiographs, ordering of appropriate test/analysis and consultations.

Examination and Diagnosis, Prosthodontic, Fixed Oral Rehabilitation, to include:  
(a) History, Medical and Dental;  
(b) Clinical Examination of Hard and Soft Tissues, including carious lesions, missing teeth, determination of sulcular depth, gingival contours, mobility of teeth, interproximal tooth contact relationships, occlusion of teeth, TMJ, pulp vitality test/analysis, where necessary and any other pertinent factors; 
(c) evaluation of specific sites for implant-supported or retained prosthesis;
(d) Radiographs extra, as required
